import "./App.css";
import "./index.css";
import Moscu from "./Images/moscu.jpg";

function App() {
  return (
    <div className="App bg-black">
      <div className="">
        <img className="w-9/12 ms-44 h-1/6" src={Moscu} alt="moscu" />
      </div>
    </div>
  );
}

export default App;
